<p><hi rend="bold">جامالتېرەك يېزىسى</hi> (<ref target="https://ug.wikipedia.org/wiki/ئۇيغۇر_لاتىن_يېزىقى">ئۇيغۇر لاتىن يېزىقى</ref>:<hi rend="bold">Jamaltérek Yézisi</hi>) <ref target="https://ug.wikipedia.org/wiki/قىزىلسۇ_قىرغىز_ئاپتونوم_ئوبلاستى">قىزىلسۇ قىرغىز ئاپتونوم ئوبلاستى</ref> نىڭ <ref target="https://ug.wikipedia.org/wiki/ئاقتو_ناھىيىسى">ئاقتو ناھىيىسى</ref> گە جايلاشقان.</p>
مەمۇرىي رايونلار
<p>قاشبويى كەنتى، سەككىز ئېرىق كەنتى قاتارلىقلار.</p>
